            color: #fff;
        }
    }

    .contact {
        border: none;
        border-radius: 0;
        padding-bottom: 70px;

        a {
            color: $primaryColor;
        }
    }
}

.left-text {
    z-index: 1;
}
.right-img {
    z-index: -1;
}

