    display: grid;
    grid-template-areas:
        "name email"
        "message message";
    grid-gap: 1.2rem;
    margin-bottom: 1.2rem;

    // grid Areas
    .name-input {
        grid-area: name;
    }
    .email-input {
        grid-area: email;
    }
    .message-input {
        grid-area: message;
        resize: none;
        height: 200px;
    }

    .text-input {
        padding: 0.5rem 1rem;
        background: #333;
        color: #fff;
        box-shadow: none;
        font-family: "Poppins", sans-serif;
        border-radius: 3px;
        border: none;

        &::placeholder {
            color: #fff;
            font-family: "Poppins", sans-serif;
        }
    }
